INSERT INTO `issue` VALUES (5,NULL,'Upload individu','Untuk template upload individu, jika upload dibatasi s.d. 50 di template diberi note agar admin tahu atas batasan tersebut. Apakah untuk upload massive yang lain juga dibatasi dengan jumlah yang sama? Menurut saya, jangan !! Apalagi untuk peserta diklat, upload massive minimal sekali upload bisa 100 peserta.','',NULL,0,'2014-11-07 01:45:53',8,'2014-11-07 03:56:20',27),(6,5,'label','discussion','','discussion',1,'2014-11-07 02:07:53',27,'2014-11-07 02:07:53',27),(7,5,'comment','upload individu kenapa pak?','','',1,'2014-11-07 02:08:11',27,'2014-11-07 02:08:11',27),(8,5,'comment','testing issue jalan kok','',NULL,1,'2014-11-07 02:10:01',7,'2014-11-07 02:10:01',7),(9,5,'comment','hadir','','',1,'2014-11-07 02:17:15',30,'2014-11-07 02:17:15',30),(10,5,'label','discussion','','discussion',1,'2014-11-07 02:19:08',28,'2014-11-07 02:19:08',28),(11,NULL,'Test Issue','Apakah content ini terbaca???','',NULL,0,'2014-11-07 02:23:41',7,'2014-11-07 03:56:36',27),(12,11,'comment','YESS !!!!','',NULL,1,'2014-11-07 02:54:07',8,'2014-11-07 02:54:07',8),(13,5,'comment','Upload peserta udah bisa maksimal 100peserta','','',1,'2014-11-07 03:56:12',27,'2014-11-07 03:56:12',27),(14,5,'status','2','','',0,'2014-11-07 03:56:20',27,'2014-11-07 03:56:20',27),(15,11,'status','2','','',0,'2014-11-07 03:56:36',27,'2014-11-07 03:56:36',27),(16,NULL,'Penambahan Info untuk manaj. individu, manaj. pegawai dan manaj. user','Saat ini, setelah Upload data individu massal dengan mencantumkan data organisation, maka pada data pegawai (manaj. pegawai) akan tersimpan juga data organisationnya, namun pada saat melihat/edit melalui manaj. individu, data organisation tidak otomatis terisi (termasuk chairman, dll).\r\n\r\nJuga bisa dimunculkan juga nama pegawai dan id organisation nya pada saat ingin diberikan assignment (edit assignment) terhadap pegawai tersebut sebagai informasi ke admin akan kedudukan/status kepegawaiannya. Sehubungan dengan pegawai tersebut diberikan assignment lebih dari seharusnya (multi assignment) maka itu bergantung dari kebijakan masing-masing satker','5460590d7e3e6.JPG',NULL,0,'2014-11-10 01:19:57',28,'2014-11-10 03:40:16',27),(17,16,'status','1','54605a18817a9.JPG','discussion',1,'2014-11-10 01:24:24',28,'2014-11-10 01:24:24',28),(18,16,'comment','Ini untuk yang assignment','54605a81bbb55.JPG','',1,'2014-11-10 01:26:09',28,'2014-11-10 01:26:09',28),(19,16,'label','verified','','verified',1,'2014-11-10 01:34:39',27,'2014-11-10 01:34:39',27),(20,16,'comment','Ini untuk yang assignment','54605cae9f522.JPG','',1,'2014-11-10 01:35:26',28,'2014-11-10 01:35:26',28),(21,16,'comment','Oke sudah di update.. thx','',NULL,1,'2014-11-10 03:38:52',8,'2014-11-10 03:38:52',8),(22,16,'label','enhancement','','enhancement',1,'2014-11-10 03:39:38',27,'2014-11-10 03:39:38',27),(23,16,'status','2','','',0,'2014-11-10 03:40:16',27,'2014-11-10 03:40:16',27),(24,NULL,'Ganti password baru','Pada saat ganti password baru, harusnya user mengisi 2x untuk memastikan user telah mengetik password yang diinginkan. Dalam aplikasi ini, password baru hanya diketikkan 1x dan itu dapat beresiko salah ketik terhadap password penggantinya.','',NULL,1,'2014-11-10 23:32:48',28,'2014-11-10 23:32:48',28),(25,24,'label','enhancement','','enhancement',1,'2014-11-11 02:02:27',27,'2014-11-11 02:02:27',27),(26,NULL,'program dan menu','Ijin bertanya, .\r\n1. apakah BDK hanya bisa memilih program yang sudah ada saja pada saat create diklat? (jadi yang membuat program siapa? Pusdiklat semua?)\r\n2. apakah perbedaan menu \"diklat\" pada sub menu pengelolaan aset pada menu subbagian TUKI? (seperti attachment berikut, soalnya ada 2 buah sub menu \"diklat\")','546ab8f0ead4d.png',NULL,1,'2014-11-17 22:11:44',11,'2014-11-17 22:11:44',11),(27,26,'comment','1. Yang create program diklat adalah Pusdiklat saja, BDK hanya mencreate berdasarkan program diklat dari Pusdiklat.\r\n2. Itu kesalahan sistem, akan di verifikasi','',NULL,1,'2014-11-18 01:06:07',101,'2014-11-18 01:06:07',101),(28,26,'comment','Terima kasih atas jawabannya Mas Hafid..\r\nijin bertanya lagi, masih ada yang belum paham tentang menu menu yang ada, karena sedikit berbeda dengan aplikasi myheart yang dulu juga pernah di UAT kan..\r\n1. Siapakah yang bisa menunjuk PIC diklat? di bagian mana cara penunjukkannya?\r\n2. Di sub menu manajemen kelas, kenapa di bagian yang saya lingkari (gambar attachment) tidak bisa di klik, atau data error? apakah ada data yang harus di input dahulu?\r\n3. Apa fungsi get random student?','546c3d4468a16.png',NULL,1,'2014-11-19 01:48:36',11,'2014-11-19 01:48:36',11),(29,26,'comment','attachment harus satu satu ya Mas? :D','546c3d70db17a.png',NULL,1,'2014-11-19 01:49:20',11,'2014-11-19 01:49:20',11),(30,26,'comment','1). set PIC hanya bisa dilakukan oleh Eselon IV pada bidang itu.. nah jika udah diset Eselon IV tetep gak bisa silahkan dilaportkan lagi. 2) Ini konsep baru.. konsep class, dimana peserta yang udah didafatarkan pada diklat belum bener2 menjadi peserta jika belum didaftarkan pada kelas.. nah fungsi dari get random itu untuk mendistribusikan secara random peserta ke masing2 kelas secara proposional dan otomatis berdasarkan random nama, unit dan jenis kelamin.','','',1,'2014-11-19 05:49:42',27,'2014-11-19 05:49:42',27),(31,26,'label','discussion','','discussion',1,'2014-11-19 05:49:50',27,'2014-11-19 05:49:50',27),(32,26,'comment','1. untuk set PIC sepertinya belum bisa di set meskipun dengan akun eselon IV,        2. untuk mendaftarkan secara manual agar benar benar menjadi peserta gimana caranya ya Mas? tidak usah memakai random.','',NULL,1,'2014-11-19 23:02:26',11,'2014-11-19 23:02:26',11),(33,NULL,'Masukan dari BDK Malang','1. Login sebagai user, Menu sebelah kiri tidak otomatis keluar<br />\r\n2. Sie Penyelenggaraan agar dapat mengcreate pengajar melalui manajemen individu, bukan hanya melakukan assign terhadap individu sebagai pengajar<br />\r\n3. Interface create individu untuk user admin berbeda dengan user bdk di tata usaha<br />\r\n4. Belum ada template untuk input peserta diklat<br />\r\n5...','',NULL,1,'2014-11-19 23:17:54',771,'2014-11-20 20:01:27',30),(34,NULL,'Hasil UAT SIMBPPK BDK Makassar','1. Tidak bisa menambahkan mata pelajaran pada diklat yang dibuat, apakah memang pusdiklat yang meng entry mata pelajaran?<br />\r\n2. Tidak bisa memilih PIC diklat, padahal eselon 4 penyelenggaraan sudah di set.<br />\r\n3. Diklat yang sudah diubah statusnya selain \"Execute\", yaitu \"plan\" \"cancel\", memang tidak dapat diubah - ubah / diedit sama sekali ya? tidak bisa di ubah.<br />\r\n4. mengenai fitur yang berhubungan dengan \"peserta\" saya menyimpulkan ada 3 fitur : 1.  manajemen peserta 2. Katalog Peserta Diklat dan 3. \"get random student\" pada Manajemen Kelas Diklat.<br />\r\n    --- jika kita menggunakan fitur \"get random student\" mengapa peserta yang berada di fitur \"manajemen peserta\" juga masuk dalam list \"get random student\" seharusnya hanya yang berada di \"Katalog Peserta Diklat\" saja.<br />\r\nTerimakasih sebelumnya, sementara baru itu yang bisa kami sampaiakan, semoga membantu.','',NULL,1,'2014-11-20 02:45:32',15,'2014-11-20 03:55:43',27),(35,34,'comment','1. Ya pusdiklat yang mengentry<br />\r\n2. Kami akan verifikasi<br />\r\n3. Harusnya bisa, harus kami cek lagi<br />\r\n4. Ini konsep baru... peserta yang belum didaftarkan pada kelas (melalui get random) artinya bukan merupakan peserta yang benar2 mengikuti diklat.. misal dia digantikan, atau mengundurkan diri.. maka data dia tetep tercatat tapi tidak sebagaoi peserta yang aktif atau hadir..','','',1,'2014-11-20 03:40:09',27,'2014-11-20 04:11:10',27),(36,33,'status','1. Kami membutuhkan skrinsutnya\r\n2. Masukan kami tampung, akan kami pertimbangkan pada proses evaluasi uat\r\n3. Kami membutuhkan skrinsutnya\r\n4. Template untuk input peserta diklat sudah ada. Masuk ke halaman peserta lalu scroll kebawah, disana ada teks \"template\" yang bisa didownload\r\n\r\nUntuk poin nomor 1 dan 3, skrinsutnya bisa dilayangkan ke fajarwahyuabdillah@gmail.com\r\n\r\nTerima kasih','','discussion',1,'2014-11-20 20:00:19',15,'2014-11-20 20:00:19',15),(37,33,'status','1','','discussion',1,'2014-11-20 20:01:11',30,'2014-11-20 20:01:11',30),(38,33,'status','1. Kami membutuhkan skrinsutnya\r\n2. Masukan kami tampung, akan kami pertimbangkan pada proses evaluasi uat\r\n3. Kami membutuhkan skrinsutnya\r\n4. Template untuk input peserta diklat sudah ada. Masuk ke halaman peserta lalu scroll kebawah, disana ada teks \"template\" yang bisa didownload\r\n\r\nUntuk poin nomor 1 dan 3, skrinsutnya bisa dilayangkan ke fajarwahyuabdillah@gmail.com\r\n\r\nTerima kasih','','discussion',1,'2014-11-20 20:01:27',30,'2014-11-20 20:01:27',30),(39,33,'comment','1. Kami membutuhkan skrinsutnya<br />\r\n2. Masukan kami tampung, akan kami pertimbangkan pada proses evaluasi uat<br />\r\n3. Kami membutuhkan skrinsutnya<br />\r\n4. Template untuk input peserta diklat sudah ada. Masuk ke halaman peserta lalu scroll kebawah, disana ada teks \"template\" yang bisa didownload<br />\r\n<br />\r\nUntuk poin nomor 1 dan 3, skrinsutnya bisa dilayangkan ke fajarwahyuabdillah@gmail.com<br />\r\n<br />\r\nTerima kasih','','',1,'2014-11-20 20:01:35',30,'2014-11-20 20:02:49',30),(40,NULL,'Masukan dr BDK Cimahi','Selamat siang, terdapat beberapa masukan/pertanyaan terkait SIM BPPK.<br />\r\n1. kami sudah pernah input pegawai sebanyak 3 orang untuk latihan, waktu kami sudah akan upload seluruh pegawai, data 3 orang tersebut kami delete dari SIM BPPK dan telah kami masukkan ke dalam template yang akan diupload. sewaktu kami upload data pegawai keseluruhan, nama 3 orang yang sudah pernah kami hapus itu tidak muncul. mohon petunjuk.<br />\r\n2. untuk data Widyaiswara, di template sudah kami masukkan jabatannya yaitu \"Widyaiswara\". namun, di SIM BPPK, data widyaiswara tersebut menjadi \"Pelaksana\". kami sudah merubah di update person bagian Office dari pelaksana menjadi Widyaiswara, tetapi begitu kami buka user role (untuk insert role pegawai), data masih \"Pelaksana\". mohon arahan.<br />\r\n<br />\r\nTerima kasih.','546ebec047b40.png',NULL,1,'2014-11-20 23:25:36',16,'2014-11-20 23:25:36',16),(41,NULL,'Profil Individu, mencatat infonya sampai sajauh mana?','Saat masuk ke manajemen Individu, sejauh mana info asal seorang individu itu bisa dicatat, misalnya mulai dari unit es. 1 s.d. es. 4 nya dan juga pendidikan, mulai dari SD s.d. S3...<br />\r\nBagaimana cara mencatat sampai selengkap demikian? Karena interface nya sepertinya hanya pilihan saja, tidak ada penambahan data yang bertingkat.<br />\r\n<br />\r\nThanks','',NULL,1,'2014-11-23 21:22:58',28,'2014-11-23 21:22:58',28);
